import React from "react";
import "./Hero.css";

function Hero() {
  return (
    <section className="hero-section">
      <div className="hero-overlay"></div>
      <div className="hero-content">
        <h1>Music WordPress Theme</h1>
        <h2>Dedicated to Bands, Labels, Festivals, Music Store and More...</h2>
        <p>No Coding Required</p>
        <button className="hero-btn">View Demos</button>
      </div>
    </section>
  );
}

export default Hero;
